import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div className="App">
        {loggedIn &&
          items.map(item => (
            <div>
              {item.name}
              <img src={item.images[0].url} height="200" />
            </div>
          ))}
      </div>
    );
  }
}

export default Home;
